import React from 'react'

const Card = ({contest}) => {

    function Duration()
    {
        let dur=(contest.duration)/(60*60);
        if(dur<24)
            return `${dur.toFixed(2)}`
    }

  return (
    <div className='w-[300px] bg-bgDark opacity-80 rounded-md overflow-hidden'>
        {/* <img src={course.image.url} /> */}
        <div  className='p-4'>
            <p className='text-white font-semibold text-lg leading-6'>
                {
                    contest.name.length>40?(contest.name.substr(0,40))+"...":(contest.name)
                }
            </p>
            <p className='mt-2 text-white'>Date:  
            {
                contest.start_time.includes(' ')?
                contest.start_time.split(' ')[0]:
                contest.start_time.split('T')[0]
            }</p>
            <p className='mt-2 text-white'>Duration:
                {
                    // (contest.duration)/(60*60)<24?((contest.duration)/(60*60)).toFixed(2):
                    // (contest.duration)/(60*60*24) 
                    Duration()
                }
                hr
            </p>
        </div>
    </div>
  )
}

export default Card
